import { render } from '@testing-library/react';
import React, { Component } from 'react';


export default class LoggingButton extends React.Component {
    AppBar = () => {

        const Menu = props => (
            <div id="appBar">
                <button onClick={this.handleClick}>
                    Click me
                </button>
                <h2 id="titulo"  >Wdemy </h2> 
            </div>
        )
        return (
            <>
            <div id="menu">
                   <Menu />
            </div>
            </>
        )
    }
}
